import React from "react";

const Order = (props) => {
  console.log(props);
  return (
    <div className="card my-2 shadow">
      <div className="card-body">
        <h6>
          <i className="fa fa-arrow-right">{props.productName}</i>
          {props.isPaymentCompleted === false ? (
<div className="float-right m-3">
  <button className="btn btn-sm primary btn-info warning"><i className="fa fa-truck"></i>Buy Now</button>
  <button className="btn btn-sm  btn-danger  ms-4"><i className="fa fa-tra"></i>Delete Order</button>

</div>
          ):("")}
        </h6>
        <table className="table table-sm table-borderless mt-1"></table>
        <tbody>
            <tr>
                <td style={{width:'100px'}}>Quantity</td>
                
            </tr>
            <tr>
                <td style={{width:'100px'}}>Price</td> 
            </tr>
          
        </tbody>
      </div>
    </div>
  )
};

export default React.memo(Order);
